import React from 'react';
import LoginAuth from '../Authorization/LoginAuth';
import WarningPasswordNotConfimed from '../../components/WarningWindow/WarningPasswordNotConfimed';

function Authorization(props) {

    return (
        <>
            {
                props.flag ?
                    <LoginAuth />
                    : <WarningPasswordNotConfimed
                        onclick={props.onclick}
                        classname={props.classname}
                        />
            }
            
        </>

    )
}

export default Authorization
